import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the listings to load
    await page.waitForSelector('.listing-rating');

    // Extract listings with ratings of 4.8 or higher
    const listings = await page.evaluate(() => {
      const elements = document.querySelectorAll('.listing-rating');
      const results = [];
      elements.forEach(element => {
        const ratingText = element.innerText;
        const rating = parseFloat(ratingText);
        if (rating >= 4.8) {
          const listingId = element.closest('.listing-item').getAttribute('data-id'); // Assuming each listing has a data-id attribute
          results.push({ id: listingId, rating });
        }
      });
      return results;
    });

    // Take a screenshot after extraction
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_extraction.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_extraction.png'));

    return {
      success: true,
      action: "Extracted listings with ratings of 4.8 or higher",
      extractedData: listings,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

